import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className="centrado">
      <h1 className="color bla">BIENVENIDO A LA OMBD</h1>
      <p className="color bla">
        Haz click para loguearte o crearte un usuario!
      </p>
      <Link to="/login">
        {" "}
        <button type="button" className="btn btn-primary boton">
          Ya tengo un usuario creado
        </button>
      </Link>
      <Link to="/newuser">
        <button type="button" className="btn btn-secondary boton">
          Crear nuevo usuario
        </button>
      </Link>
    </div>
  );
};

export default Home;
